// src/patient/PatientDashboard.js
import React, { useEffect, useState } from 'react';
import { getData, decodeToken } from '../api/endpoint';
import './PatientDashboard.css';

const PatientDashboard = () => {
  const [dossiers, setDossiers] = useState([]);
  const [rendezVous, setRendezVous] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Récupérer l'id du patient depuis le token
  const token = localStorage.getItem('token');
  const decoded = decodeToken(token);
  const patientId = decoded?.id;

  const loadDossiers = async () => {
    try {
      const data = await getData(`/mes-dossiers?patientId=${patientId}`);
      setDossiers(data);
    } catch (err) {
      console.error("Erreur chargement dossiers:", err);
      setError(err.message);
    }
  };

  const loadRendezVous = async () => {
    try {
      const data = await getData(`/rendezvous?patientId=${patientId}`);
      setRendezVous(data);
    } catch (err) {
      console.error("Erreur chargement rendez-vous:", err);
      setError(err.message);
    }
  };

  useEffect(() => {
    if (!patientId) {
      setError("Impossible de récupérer l'identifiant patient");
      setLoading(false);
      return;
    }
    const fetchData = async () => {
      setLoading(true);
      await Promise.all([loadDossiers(), loadRendezVous()]);
      setLoading(false);
    };
    fetchData();
  }, [patientId]);

  if (loading) return <p>Chargement des données...</p>;
  if (error) return <p className="text-red-500">{error}</p>;

  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold mb-4">Tableau de bord Patient</h1>

      {/* Dossiers Médicaux */}
      <section className="mb-6">
        <h2 className="text-xl font-semibold mb-2">Mes Dossiers Médicaux</h2>
        {dossiers.length === 0 ? (
          <p>Aucun dossier trouvé.</p>
        ) : (
          <table className="w-full border border-gray-300">
            <thead>
              <tr className="bg-gray-200">
                <th className="p-2 border">ID</th>
                <th className="p-2 border">Médecin</th>
                <th className="p-2 border">Date</th>
                <th className="p-2 border">Description</th>
              </tr>
            </thead>
            <tbody>
              {dossiers.map((d) => (
                <tr key={d._id}>
                  <td className="p-2 border">{d._id}</td>
                  <td className="p-2 border">{d.medecinName || "N/A"}</td>
                  <td className="p-2 border">{new Date(d.date).toLocaleDateString()}</td>
                  <td className="p-2 border">{d.description || "Aucune description"}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </section>

      {/* Rendez-vous */}
      <section>
        <h2 className="text-xl font-semibold mb-2">Mes Rendez-vous</h2>
        {rendezVous.length === 0 ? (
          <p>Aucun rendez-vous prévu.</p>
        ) : (
          <table className="w-full border border-gray-300">
            <thead>
              <tr className="bg-gray-200">
                <th className="p-2 border">ID</th>
                <th className="p-2 border">Médecin</th>
                <th className="p-2 border">Date</th>
                <th className="p-2 border">Statut</th>
              </tr>
            </thead>
            <tbody>
              {rendezVous.map((r) => (
                <tr key={r._id}>
                  <td className="p-2 border">{r._id}</td>
                  <td className="p-2 border">{r.medecinName || "N/A"}</td>
                  <td className="p-2 border">{new Date(r.date).toLocaleString()}</td>
                  <td className="p-2 border">{r.status || "N/A"}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </section>
    </div>
  );
};

export default PatientDashboard;
